import React from 'react';
import logo from './logo.svg';
import js from './js.svg';
import './App.css';

const formatName = (user) => `${user.firstName.toLowerCase()} ${user.lastName.toLowerCase()}`;
const user = { firstName: 'John', lastName: 'Santucci'};
const element = (<h1>{formatName(user)}</h1>);

function App() {
  return (
    <div className="App">
      <div className="flexContainer header">
        <div className="flex3Column green"></div>
        <div className="flex3Column yellow"></div>
        <div className="flex3Column red"></div>
      </div>
      <header className="App-header">
        <div className="flexContainer">
          <div className="flex3Column"></div>
          <div className="flex3Column">
            <img src={logo} className="App-logo1" alt="logo" />
            <img src={logo} className="App-logo2" alt="logo" />
          </div>
          <div className="flex3Column"></div>
        </div>

          { element }
        <a className="App-link"
          href="https://jsongithub.github.io/portfolio/"
          target="_self"
          rel="noopener noreferrer"
        >
          portfolio
        </a>
      </header>
      <div className="flexContainer footer">
        <div className="flex3Column red"></div>
        <div className="flex3Column yellow"></div>
        <div className="flex3Column green"></div>
      </div>
    </div>
  );
}

export default App;
